      SELECT - col0 col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col2 BETWEEN - - col0 * + CAST ( NULL AS INTEGER ) AND - - ( - col2 ) / - + col2;
  - name: tab0

outputs:
  - name: q10448.out
    data: |
